import React, { useEffect, useState } from 'react';
import axios from 'axios';

const InventoryPage = () => {
  const [inventory, setInventory] = useState([]);
  const [viewMode, setViewMode] = useState('update'); // 'view' or 'update'
  const [editingItem, setEditingItem] = useState(null);
  const [updatedItem, setUpdatedItem] = useState({ name: '', description: '', location: '', count: '' });

  useEffect(() => {
    fetchInventory();
  }, []);

  const fetchInventory = async () => {
    try {
      const res = await axios.get('http://localhost:5050/api/inventory/');
      setInventory(res.data);
    } catch (err) {
      console.error('Error fetching inventory:', err);
    }
  };

  const groupByRack = (items) => {
    const grouped = {};
    items.forEach(item => {
      const rack = item.location && item.location.trim() !== '' ? item.location.toUpperCase() : 'Unknown Rack';
      if (!grouped[rack]) grouped[rack] = [];
      grouped[rack].push(item);
    });
    return grouped;
  };

  const handleEditClick = (item) => {
    setEditingItem(item);
    setUpdatedItem({
      name: item.name,
      description: item.description || '',
      location: item.location || '',
      count: item.count || ''
    });
  };

  const handleEditChange = (e) => {
    const { name, value } = e.target;
    setUpdatedItem(prev => ({ ...prev, [name]: value }));
  };

  const handleEditSubmit = async () => {
    try {
      const res = await axios.put(`http://localhost:5050/api/inventory/${editingItem._id}`, updatedItem);
      console.log('Item updated:', res.data);
      setEditingItem(null);
      fetchInventory();
    } catch (err) {
      console.error('Error updating item:', err);
    }
  };

  const handleDelete = async (id) => {
    const confirmDelete = window.confirm('Are you sure you want to delete this item?');
    if (!confirmDelete) return;

    try {
      await axios.delete(`http://localhost:5050/api/inventory/${id}`);
      alert('Item deleted successfully');
      fetchInventory();
    } catch (err) {
      console.error('Error deleting item:', err);
      alert('Failed to delete item');
    }
  };

  return (
    <div style={styles.container}>
      <h2>üì¶ Inventory Items</h2>
      <div style={styles.toggleBtns}>
        <button onClick={() => setViewMode('view')} style={styles.toggleBtn}>View Mode</button>
        <button onClick={() => setViewMode('update')} style={styles.toggleBtn}>Update Mode</button>
      </div>

      {viewMode === 'view' ? (
        Object.keys(groupByRack(inventory)).length === 0 ? (
          <p>No items available to display.</p>
        ) : (
          Object.entries(groupByRack(inventory)).map(([rack, items]) => (
            <div key={rack} style={styles.rackGroup}>
              <h3>üìç Rack {rack}</h3>
              <table style={styles.table}>
                <thead>
                  <tr>
                    <th>Item Name</th>
                    <th>Description</th>
                    <th>Count</th>
                  </tr>
                </thead>
                <tbody>
                  {items.map(item => (
                    <tr key={item._id}>
                      <td>{item.name}</td>
                      <td>{item.description || '‚Äî'}</td>
                      <td>{item.count}</td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          ))
        )
      ) : (
        <table style={styles.table}>
          <thead>
            <tr>
              <th>Item Name</th>
              <th>Description</th>
              <th>Location</th>
              <th>Count</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {inventory.map(item => (
              <tr key={item._id}>
                <td>{item.name}</td>
                <td>{item.description || '‚Äî'}</td>
                <td>{item.location}</td>
                <td>{item.count}</td>
                <td>
                  <button style={styles.editBtn} onClick={() => handleEditClick(item)}>Edit</button>
                  <button style={styles.deleteBtn} onClick={() => handleDelete(item._id)}>Delete</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      )}

      {/* Edit Modal */}
      {editingItem && (
        <div style={styles.modalOverlay}>
          <div style={styles.modal}>
            <h3>Edit Inventory Item</h3>
            <label>
              Name: <input type="text" name="name" value={updatedItem.name} onChange={handleEditChange} />
            </label><br />
            <label>
              Description: <input type="text" name="description" value={updatedItem.description} onChange={handleEditChange} />
            </label><br />
            <label>
              Location: <input type="text" name="location" value={updatedItem.location} onChange={handleEditChange} />
            </label><br />
            <label>
              Count: <input type="number" name="count" value={updatedItem.count} onChange={handleEditChange} />
            </label><br />
            <button onClick={handleEditSubmit} style={{ marginTop: 10 }}>Save</button>
            <button onClick={() => setEditingItem(null)} style={{ marginLeft: 10 }}>Cancel</button>
          </div>
        </div>
      )}
    </div>
  );
};

const styles = {
  container: {
    padding: '30px',
    background: 'linear-gradient(to right, #0f2027, #203a43, #2c5364)',
    minHeight: '100vh',
    color: 'white'
  },
  toggleBtns: {
    marginBottom: '20px',
    display: 'flex',
    gap: '10px'
  },
  toggleBtn: {
    backgroundColor: '#1e90ff',
    border: 'none',
    color: 'white',
    padding: '8px 16px',
    borderRadius: '6px',
    cursor: 'pointer',
    fontWeight: 'bold'
  },
  rackGroup: {
    backgroundColor: 'white',
    color: 'black',
    padding: '10px',
    borderRadius: '8px',
    marginBottom: '20px'
  },
  table: {
    width: '100%',
    borderCollapse: 'collapse',
    marginTop: '10px',
    backgroundColor: '#fff',
    color: '#000'
  },
  editBtn: {
    backgroundColor: '#007bff',
    color: 'white',
    padding: '6px 10px',
    marginRight: '5px',
    border: 'none',
    borderRadius: '4px'
  },
  deleteBtn: {
    backgroundColor: '#dc3545',
    color: 'white',
    padding: '6px 10px',
    border: 'none',
    borderRadius: '4px'
  },
  modalOverlay: {
    position: 'fixed',
    top: 0, left: 0, right: 0, bottom: 0,
    backgroundColor: 'rgba(0,0,0,0.6)',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center'
  },
  modal: {
    backgroundColor: '#fff',
    padding: '20px',
    borderRadius: '10px',
    color: '#000',
    minWidth: '300px'
  }
};

export default InventoryPage;
